import './App.css';

function App() {
  let teacher = '정새싹';

  function inEnglish() {
    teacher = 'tetz';
    console.log(teacher);
  }

  return (
    <div className="App">
      <button onClick={() => inEnglish()}>영어로!</button>
      <br />
      <span>{teacher}</span>
    </div>
  );
}

export default App;
